        //---------------------------------------------------------------------------------
        //- Init PIXI

        function InitPixi(){
            var size = getScreenSize()
            //-		
            
            appObj.canvasWidth=Math.ceil(window.innerWidth);
            appObj.canvasHeight=Math.ceil(window.innerHeight);
            
            AppCanvas.id="AppCanvas";
            AppCanvas.width=appObj.canvasWidth;
            AppCanvas.height=appObj.canvasHeight; 

            renderer = new PIXI.autoDetectRenderer(
                appObj.canvasWidth, 
                appObj.canvasHeight,
                {view:AppCanvas, transparent:true, antialias:true}
            );

            renderer.transparent = true;

            document.getElementById('pixi').append(renderer.view);

            stage = new PIXI.Container();
            stage.position.set(Math.ceil(appObj.canvasWidth*0.5), Math.ceil(appObj.canvasHeight*0.5));	
            
            loader = new AssetsPreloader(window.imgsrc);
            loader.preload(ProccesingInitAd)

        }

        function AddMoney(num, time){

            demoScore += num
            gsap.to(totalScore, {duration:1, delay:time, score:demoScore, 
                onUpdate:function(){
                appMc.paypalT.text = totalScore.score.toFixed(2);

        //------------------------------------------------------------------
        //- btn-event

        function onDragStart(event) {
            appMc.dbRap.animation.play('money_old', !1);
            appMc.moneyEmitter.emit = !0;
            isDrag = true;
            gsap.to(appMc.tipsContainer, { duration: .3, alpha: 0})
            appMc.mcswipeSprite.stop()

            DragStart = appMc.tipsContainer.toLocal(event.data.global)
            halobtn(getRandom(1,5))
            appMc.pointEmitter.emit = !0;

            moveTimer = Date.now();

            if(!musicStart){
                appSounds.music.play();
            }

            musicStart = true
        }

        function onDragEnd() {

            isDrag = false;

            appMc.dbRap.animation.play('idle', !1);
            appMc.moneyEmitter.emit = !1;

            gsap.to(appMc.tipsContainer, { duration: .3, alpha: 1})
            appMc.mcswipeSprite.play()

            gsap.to(appMc.mcBg, {overwrite:true})
            appMc.mcBg.shake = false
            appMc.PiontContainer.visible = 0;

            appMc.dbRap.animation.timeScale = 1
            appMc.moneyEmitter.maxParticles = 60

        }

        function onDragMove(event) {
            if(isDrag){
                var itempoint = appMc.tipsContainer.toLocal(event.data.global)
                var number = Math.pow(Math.abs(itempoint.x - DragStart.x),2) + Math.pow(Math.abs(itempoint.y - DragStart.y),2)
                
                if( number > 10000){

                    var itemMove = Date.now();

                    if((itemMove - moveTimer) < 50){
                        appMc.dbRap.animation.timeScale = 1.5
                        appMc.moneyEmitter.maxParticles = 120
                        appSounds.star.play();
                        halobtn(getRandom(25,35))
                    }else if((itemMove - moveTimer) < 60){
                        appMc.dbRap.animation.timeScale = 1.3
                        appMc.moneyEmitter.maxParticles = 100
                        appSounds.star.play();
                        halobtn(getRandom(15,25))
                    }else if((itemMove - moveTimer) < 70){
                        appMc.dbRap.animation.timeScale = 1.1
                        appMc.moneyEmitter.maxParticles = 80
                        halobtn(getRandom(5,15))
                    }else{
                        appMc.dbRap.animation.timeScale = 1
                        appMc.moneyEmitter.maxParticles = 60
                        halobtn(10)
                        halobtn(getRandom(1,5))
                    }

                    moveTimer = itemMove

                    DragStart = itempoint

                    if(!appMc.mcBg.shake){
                        gsap.to(appMc.mcBg, {duration:.05, x:appMc.mcBg.x + 16, yoyo:true, repeat:-1})
                    }
                    appMc.mcBg.shake = true;

                    appSounds.money.play();
                    appMc.PiontContainer.visible = 1;
                    appMc.pointEmitter.spawnPos.x = DragStart.x
                    appMc.pointEmitter.spawnPos.y = DragStart.y
                    appMc.pointEmitter.emit = !0;

                    endTime++
                    if(endTime > overTime){
                        EndGame()
                    }
                }

                // console.log(DragStart)
                // if()
                // appMc.pointEmitter.spawnPos.x = appMc['dog'+dragindex].x
                // appMc.pointEmitter.spawnPos.y = appMc['dog'+dragindex].y
                // appMc.pointEmitter.emit = true
            }
        }

        function halobtn(money){
            var id = idSwipeEff
            appMc["haloContainer"+id].alpha = 1;
            appMc["haloContainer"+id].x = DragStart.x 
            appMc["haloContainer"+id].y = DragStart.y

            appMc['haloT'+id].text = "$"+money.toString()

            AddMoney(money, 0)
            gsap.to(appMc["haloContainer"+id].scale, {duration:.08, x:2, y:2, onComplete:function(){ appMc["haloContainer"+id].alpha = 0; appMc["haloContainer"+id].scale.set(1) } })

            idSwipeEff++
            if(idSwipeEff === totalSwipeEff){
                idSwipeEff = 0;
            }
        }

        function getRandom(min, max) {
            return Math.floor(Math.random() * (max - min + 1)) + min
        }

        //---------------------------------------------------------------------------------
        //- EF

        function StageEF(){

            appObj.tmFPS++;
            if(appObj.tmFPS==appObj.tmRenderFPS){

                //-

                tmDebug++
                // console.log(tmDebug)
                if(tmDebug==10){
                    tmDebug = 0;
                    //console.log('tm = ', performance.now() - time);
                }
                
                    appMc.mcMasses1Container.a += 8;
                    if(appMc.mcMasses1Container.a >= 360){ appMc.mcMasses1Container.a -= 360; };

                    if(appObj.mainWidth < appObj.mainHeight){
                        appMc.mcMasses1Container.y = appObj.canvasHeight*.3/appMc.mcMain.scale.y + 16*Math.cos(appMc.mcMasses1Container.a*toRAD);
                        appMc.mcMasses1Container.x = -1200 + 8*Math.cos(appMc.mcMasses1Container.a*toRAD)

                        appMc.mcMasses0Container.y = appObj.canvasHeight*.34/appMc.mcMain.scale.y - 16*Math.cos(appMc.mcMasses1Container.a*toRAD);
                        appMc.mcMasses0Container.x = -1200 + 10*Math.cos(appMc.mcMasses1Container.a*toRAD)
                    }else{
                        appMc.mcMasses1Container.y = appObj.canvasHeight*.2/appMc.mcMain.scale.y + 8*Math.cos(appMc.mcMasses1Container.a*toRAD);
                        appMc.mcMasses1Container.x = -1200 + 8*Math.cos(appMc.mcMasses1Container.a*toRAD)

                        appMc.mcMasses0Container.y = appObj.canvasHeight*.28/appMc.mcMain.scale.y - 16*Math.cos(appMc.mcMasses1Container.a*toRAD);
                        appMc.mcMasses0Container.x = -1200 + 10*Math.cos(appMc.mcMasses1Container.a*toRAD)
                    }

                    var now = Date.now();
                    appMc.moneyEmitter.update((now - elapsed) * 0.001);
                    appMc.pointEmitter.update((now - elapsed) * 0.001);
                    elapsed = now;

                    if(!isDrag){
                        appMc.tipsT.a += 12;
                        if(appMc.tipsT.a >= 360){ appMc.tipsT.a -= 360; };

                        appMc.tipsT.scale.set(0.95+0.05*Math.cos(appMc.tipsT.a*toRAD));
                    }

                    if(gameisend){
                        appMc.download.a += 12;
                        if(appMc.download.a >= 360){ appMc.download.a -= 360; };
                        appMc.download.scale.set(0.8+0.05*Math.cos(appMc.download.a*toRAD));
                    }

                //- PIXI RENDER

                appObj.tmFPS=0;
                renderer.render(stage);


            }

            //- RAF
			window.requestAnimationFrame(StageEF);

        }

        //---------------------------------------------------------------------------------
        //- Resize
        
        function getScreenSize() {
            if (window.screenSize && window.screenSize.width && window.screenSize.height) {
                return {
                width: window.screenSize.width,
                height: window.screenSize.height
                };
            } else {
                return {
                width: document.documentElement.clientWidth || window.innerWidth,
                height: document.documentElement.clientHeight || window.innerHeight
                };
            };
        }

        function Resize(){
            var w,h;
            var myWidth, myheight;
            var size = getScreenSize()
            h = size.width;
            w = size.height;
            if(size.width < size.height){
                w = size.width;
                h = size.height;
            }
            var mql = window.matchMedia("(orientation: portrait)");
            if(mql.matches){
                myWidth =  w ;
                myheight = h ;
            }else{
                myWidth = h ;
                myheight = w ;
            }

            appObj.mainWidth		= Math.ceil(myWidth);
            appObj.mainHeight		= Math.ceil(myheight); 
            appObj.canvasWidth		= Math.ceil(1.4*myWidth);
            appObj.canvasHeight		= Math.ceil(1.4*myheight);
            
            renderer.view.style.width	= appObj.mainWidth+"px";
            renderer.view.style.height	= appObj.mainHeight+"px";
            renderer.view.width			= appObj.canvasWidth;
            renderer.view.height		= appObj.canvasHeight;

            renderer.resize(appObj.canvasWidth, appObj.canvasHeight);

            stage.position.set(Math.ceil(appObj.canvasWidth*0.5), Math.ceil(appObj.canvasHeight*0.5));

            appMc.mcMain.scale.set(1, 1);

            if(appObj.mainWidth < appObj.mainHeight){
                appMc.mcMain.scale.x = appObj.canvasWidth/720;
                appMc.mcMain.scale.y = appMc.mcMain.scale.x;

                if(appMc.mcMain.scale.y*1280>appObj.canvasHeight){
                    appMc.mcMain.scale.y = appObj.canvasHeight/1280;
                    appMc.mcMain.scale.x = appMc.mcMain.scale.y;
                }

                appMc.mcBg.y = appObj.canvasHeight*0.32/appMc.mcMain.scale.y;

                appMc.mcBottomContainer.y = appObj.canvasHeight*.32/appMc.mcMain.scale.y;
                appMc.mcMasses0Container.y = appObj.canvasHeight*.34/appMc.mcMain.scale.y;
                appMc.mcMasses1Container.y = appObj.canvasHeight*.3/appMc.mcMain.scale.y;

                appMc.dbDancerContainer.x = 100-appObj.canvasWidth*.5/appMc.mcMain.scale.x;
                appMc.dbDancerContainer.y = -175+appObj.canvasHeight*.3/appMc.mcMain.scale.y;

                appMc.dbRapContainer.y = appObj.canvasHeight*.32/appMc.mcMain.scale.y;

                appMc.EFMoneyContainer.y = -140+appObj.canvasHeight*.3/appMc.mcMain.scale.y;

                appMc.Mask.scale.x = 0.1 + appObj.canvasWidth/1280/appMc.mcMain.scale.x;
                appMc.Mask.scale.y = 0.1 + appObj.canvasHeight/1280/appMc.mcMain.scale.y;

                appMc.maskContainer.scale.x = 0.1 + appObj.canvasWidth/1280/appMc.mcMain.scale.x;
                appMc.maskContainer.scale.y = 0.1 + appObj.canvasHeight/1280/appMc.mcMain.scale.y;

                appMc.paypalContainer.x = 0

                appMc.download.x = 0
                appMc.download.y = -120+appObj.canvasHeight*0.5/appMc.mcMain.scale.y

                appMc.downloadalpha.x = 0
                appMc.downloadalpha.y = -120+appObj.canvasHeight*0.5/appMc.mcMain.scale.y

                appMc.mcAgreementContainer.y = -30+appObj.canvasHeight*0.5/appMc.mcMain.scale.y;
                appMc.mcAgreementContainer.x = 0;

            }else{
                appMc.mcMain.scale.x = appObj.canvasWidth/1280;

                appMc.mcBg.y = appObj.canvasHeight*0.32/appMc.mcMain.scale.y;

                appMc.mcBottomContainer.y = appObj.canvasHeight*.32/appMc.mcMain.scale.y;

                appMc.mcMasses0Container.y = appObj.canvasHeight*.28/appMc.mcMain.scale.y;
                appMc.mcMasses1Container.y = appObj.canvasHeight*.2/appMc.mcMain.scale.y;

                appMc.dbDancerContainer.x = 260-appObj.canvasWidth*.5/appMc.mcMain.scale.x;
                appMc.dbDancerContainer.y = -114+appObj.canvasHeight*.2/appMc.mcMain.scale.y;

                appMc.dbLil_pumpContainer.x = -260+appObj.canvasWidth*.5/appMc.mcMain.scale.x;
                appMc.dbLil_pumpContainer.y = -114+appObj.canvasHeight*.2/appMc.mcMain.scale.y;

                appMc.dbRapContainer.y = appObj.canvasHeight*.32/appMc.mcMain.scale.y;

                appMc.EFMoneyContainer.y = -140+appObj.canvasHeight*.3/appMc.mcMain.scale.y;

                appMc.Mask.scale.x = 0.1 + appObj.canvasWidth/1280/appMc.mcMain.scale.x;
                appMc.Mask.scale.y = 0.1 + appObj.canvasHeight/1280/appMc.mcMain.scale.y;

                appMc.maskContainer.scale.x = 0.1 + appObj.canvasWidth/1280/appMc.mcMain.scale.x;
                appMc.maskContainer.scale.y = 0.1 + appObj.canvasHeight/1280/appMc.mcMain.scale.y;

                appMc.paypalContainer.x = 250-appObj.canvasWidth*0.5/appMc.mcMain.scale.x
                appMc.paypalContainer.y = -220+ appObj.canvasHeight*0.5/appMc.mcMain.scale.y

                appMc.download.x = -220+appObj.canvasWidth*0.5/appMc.mcMain.scale.x
                appMc.download.y = -220+appObj.canvasHeight*0.5/appMc.mcMain.scale.y

                appMc.downloadalpha.x = -220+appObj.canvasWidth*0.5/appMc.mcMain.scale.x
                appMc.downloadalpha.y = -220+appObj.canvasHeight*0.5/appMc.mcMain.scale.y

                appMc.mcAgreementContainer.y = -30+appObj.canvasHeight*0.5/appMc.mcMain.scale.y;
                appMc.mcAgreementContainer.x = 0;
            }
        }

        //---------------------------------------------------------------------------------
        //- EndGame

        function EndGame(){

            appMc.dbRap.animation.timeScale = 1
            appMc.moneyEmitter.maxParticles = 80
            appSounds.star.play();
            appSounds.esketit.play();
            
            appMc.mcBg.texture = PIXI.utils.TextureCache.bg2;
            gsap.to(appMc.mcBg, {overwrite:true})
            appMc.moneyEmitter.emit = !1;
            appMc.tipsContainer.interactive = false;

            for (i = 0; i < 20; i++) {
                appMc['mcBottom'+i].texture = PIXI.utils.TextureCache.bottom1;
            }


            appMc.flashMask.alpha = 0.8
            gsap.to(appMc.flashMask, {duration: 0.5, alpha:0,
                onComplete: function (){
                    gameisend = true
                    appMc.endMask.interactive = true;

                }
            })

            setSlot(appMc.dbRap._armature, 0, appMc.dbRapAllowSlotArr)

            appMc.dbRap.animation.play('meme', 1);

            appMc.dbRap.addDBEventListener(dragonBones.EventObject.LOOP_COMPLETE, (event) => {
                appMc.dbRap.animation.play('money_old', !1);
                appMc.moneyEmitter.emit = !0;
            }, this)

            appMc.dbLil_pump.animation.play('appear', 1);

            appMc.dbLil_pump.addDBEventListener(dragonBones.EventObject.LOOP_COMPLETE, (event) => {
                appMc.dbLil_pump.animation.play('dance_hype', !1);
            }, this)
            appMc.dbsupportingContainer.addChild(appMc.dbLil_pumpContainer);

            appMc.dbDancer.animation.play('appear', 1);

            appMc.dbDancer.addDBEventListener(dragonBones.EventObject.LOOP_COMPLETE, (event) => {
                appMc.dbDancer.animation.play('twerk', !1);
                appMc.moneyEmitter.emit = !1;
            }, this)
            appMc.dbsupportingContainer.addChild(appMc.dbDancerContainer);
            
        }
        

        //---------------------------------------------------------------------------------
        //- RAF

        var raf_lastTime = 0;
        var raf_vendors = ['ms', 'moz', 'webkit', 'o'];
        for(var x = 0; x < raf_vendors.length && !window.requestAnimationFrame; ++x) {
            window.requestAnimationFrame = window[raf_vendors[x]+'RequestAnimationFrame'];
            window.cancelAnimationFrame = window[raf_vendors[x]+'CancelAnimationFrame'] || window[raf_vendors[x]+'CancelRequestAnimationFrame'];
        } 
        if (!window.requestAnimationFrame){
            window.requestAnimationFrame = function(callback, element) {
                var currTime = new Date().getTime();
                var timeToCall = Math.max(0, 16 - (currTime - raf_lastTime));
                var id = window.setTimeout(function() { callback(currTime + timeToCall); }, timeToCall);
                raf_lastTime = currTime + timeToCall;
                return id;
            };
        }	
        if (!window.cancelAnimationFrame){
            window.cancelAnimationFrame = function(id) {
                clearTimeout(id);
            };
        }


        //---------------------------------------------------------------------------------
		//- ClickAd

        function ClickAd(){
            var A, a = navigator.userAgent;
            a.indexOf("Android") > -1 || a.indexOf("Adr");
            A = !!a.match(/\(i[^;]+;( U;)? CPU.+Mac OS X/) ? config.links.ios : config.links.android;
            try {
                "unity" == config.platform.network || "AppLovin" == config.platform.network ? NUC.trigger.convert(A) : NUC.trigger.convert()
            } catch (A) {
                NUC.trigger.convert()
            }
        }

    </script>
